import axios from 'axios';

const API_URL = 'http://127.0.0.1:8000'; // Remplacez ceci par l'URL de votre endpoint API Django

export const getUsers = async () => {
    try {
        const response = await axios.get(`${API_URL}/users/`);
        return response.data;
    } catch (error) {
        console.error('Error fetching users:', error);
        throw error; // Vous pouvez gérer l'erreur dans le composant qui appelle cette fonction
    }
};
